\{
 if\(line\.startsWith\("GET"\) \&\& line\.matches\(http_msg_regex\)\)
 processGet\(req_pattern\.matcher\(line\)\.group\(3\)\)\;
 else if\(line\.startsWith\("PUT"\)\)\{
 isPut \= true\;
 \}else if\(isPut \&\& line\.matches\(contetn_length_reg\)\)\{
 contLength \= Integer\.parseInt\(Pattern\.compile\(contetn_length_reg\)\.matcher\(line\)\.group\(3\)\)\;
 \}
 else if\(isPut \&\& line\.equals\("\r\n"\)\)\{
 isHeaderEndRchd \= true\;
 \}
 else if\(isPut \&\& isHeaderEndRchd\)\{
 if\(contLength\>\=0\)\{
 uploadedFile \= new StringBuffer\(\)\;
 uploadedFile\.append\(line\)\;
 if\(uploadedFile\.length\(\)\=\=contLength\)\{
 writeFile\(uploadedFile\)\;
 \}
 \}else\{
 stre\.println\("HTTP/1\.1 500 Error\:Content\-Length not valid/unspecified\. "\)\;
 \}
 resetPutVars\(\)\;
 \}
 \}
